import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

const Footer = () => {
  return (
    <footer className="bg-gray-900 text-white">
      <div className="container-max section-padding">
        <div className="grid grid-cols-1 md:grid-cols-4 gap-8">
          {/* Logo y descripción */}
          <div className="col-span-1 md:col-span-2">
            <div className="flex items-center mb-4 group">
              <motion.div 
                className="relative w-12 h-12 rounded-xl overflow-hidden shadow-lg group-hover:shadow-xl transition-shadow duration-300"
                whileHover={{ scale: 1.05, rotate: -5 }}
                transition={{ type: "spring", stiffness: 400, damping: 17 }}
              >
                {/* Gradiente de fondo animado */}
                <div className="absolute inset-0 bg-gradient-to-br from-primary-500 via-primary-600 to-primary-700 group-hover:from-primary-400 group-hover:to-primary-800 transition-all duration-300" />

                {/* Efectos de brillo */}
                <div className="absolute inset-0 bg-gradient-to-tr from-transparent via-white/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300" />

                {/* Contenedor del logo */}
                <div className="relative w-full h-full flex items-center justify-center">
                  {/* Aquí va tu logo - reemplaza el src con la ruta de tu imagen */}
                  <img 
                    src="/logoo.png" 
                    alt="Logo" 
                    className="w-8 h-8 object-contain filter drop-shadow-sm"
                    onError={(e) => {
                      // Fallback si no hay imagen
                      e.target.style.display = 'none';
                      e.target.nextSibling.style.display = 'block';
                    }}
                  />
                  {/* Fallback text (se oculta cuando hay imagen) */}
                  <span className="text-white font-bold text-xl hidden">M</span>
                </div>

                {/* Partículas decorativas */}
                <div className="absolute top-1 right-1 w-1 h-1 bg-white/40 rounded-full animate-pulse" />
                <div className="absolute bottom-2 left-2 w-0.5 h-0.5 bg-white/30 rounded-full animate-ping" />
              </motion.div>

              <motion.span 
                className="ml-3 text-xl font-semibold group-hover:text-primary-300 transition-colors duration-200"
                initial={{ opacity: 0, x: -10 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ delay: 0.1 }}
              >
                Tu Marca
              </motion.span>
            </div>
            <p className="text-gray-400 max-w-md">
              Servicios freelance profesionales que combinan creatividad artística con excelencia técnica.
            </p>
          </div>

          {/* Enlaces rápidos */}
          <div>
            <h3 className="font-semibold mb-4">Enlaces</h3>
            <ul className="space-y-2">
              <li><Link to="/servicios" className="text-gray-400 hover:text-white transition-colors">Servicios</Link></li>
              <li><Link to="/portfolio" className="text-gray-400 hover:text-white transition-colors">Portfolio</Link></li>
              <li><Link to="/sobre-mi" className="text-gray-400 hover:text-white transition-colors">Sobre mí</Link></li>
              <li><Link to="/blog" className="text-gray-400 hover:text-white transition-colors">Blog</Link></li>
            </ul>
          </div>

          {/* Contacto */}
          <div>
            <h3 className="font-semibold mb-4">Contacto</h3>
            <ul className="space-y-2">
              <li>
                <a href="mailto:tu@email.com" className="text-gray-400 hover:text-white transition-colors">
                  tu@email.com
                </a>
              </li>
              <li>
                <a href="https://wa.me/1234567890" className="text-gray-400 hover:text-white transition-colors">
                  WhatsApp
                </a>
              </li>
            </ul>
          </div>
        </div>

        <div className="border-t border-gray-800 mt-8 pt-8 flex flex-col md:flex-row justify-between items-center">
          <p className="text-gray-400 text-sm">
            © 2024 Tu Marca. Todos los derechos reservados.
          </p>
          <div className="flex space-x-6 mt-4 md:mt-0">
            <Link to="/privacidad" className="text-gray-400 hover:text-white text-sm transition-colors">
              Privacidad
            </Link>
            <Link to="/terminos" className="text-gray-400 hover:text-white text-sm transition-colors">
              Términos
            </Link>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
